import React, { Component } from 'react';
import './LoginPage.css';

import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';
import { Link } from 'react-router-dom';
import {
  withRouter
} from 'react-router-dom';
import Form from 'react-bootstrap/Form';

class CardTemplate extends Component {
    constructor(props){
        super(props);
        this.state = {
            message:"",
            color:""
        }

        this.sendRequest = this.sendRequest.bind(this);
        this.verifyData = this.verifyData.bind(this);
    }

    verifyData(e){
        e.preventDefault();
        var email = document.getElementById("email").value;
        var password = document.getElementById("password").value;
        this.sendRequest(email.password);
    }

    sendRequest(email,password) {
        var requestOptions = {
            method : 'POST',
            headers: {'Content-Type':'application/json'},
            body : ''
        }
    }

    render() {
        return (
            <Container id="card" md="auto">
                <Card className="text-center">
                <Card.Header>{this.props.type}</Card.Header>
                <Card.Body>
                    
                    <Form className="justify-content-center" onSubmit={this.verifyData}>
                        <Form.Group>
                            <Form.Label>Email address</Form.Label>
                            <Form.Control id="email" type="email" placeholder="Enter email" required />
                        </Form.Group>

                        <Form.Group>
                            <Form.Label>Password</Form.Label>
                            <Form.Control id="password" type="password" placeholder="Password" minLength='8' required />
                        </Form.Group>
                        
                        <Button variant="primary" type="submit">
                            {this.props.type}
                        </Button>
                    </Form>
                       
                </Card.Body> 
                </Card>
            </Container>
        );
    }
}

class LoginPage extends Component {
    render() {
        return (
            <CardTemplate type="login"/>
        );
    }
}
export default withRouter(LoginPage);
